As taxas dos contratos de juros futuros (#DI) encerraram a sessão em queda, mantendo a trajetória desde o início da sessão, apesar do vaivém dos demais ativos locais, que ficaram mais reféns do cenário externo. Ainda assim, o movimento da curva a termo foi limitado pela cena política local e pela proximidade do feriado, na segunda-feira.

Nos Estados Unidos, os principais índices do mercado de ações terminaram em baixa pelo segundo dia seguido, mas reduziram a queda no final da sessão com nomes que se beneficiariam da reabertura econômica apagando parte das fortes perdas do setor de tecnologia. Na semana, no entanto, os índices amargaram quedas acentuadas.

